'Flash CS4 Insight','This is a summary course gives a birds eye view of the upcoming Flash CS4 version and its new features.<br />\r\n<br />\r\nVishal Adsool, the author of this course attended a seminar on Flash CS4 held at Hotel Le\'Meridian by Adobe.',0,'2009-08-13 06:41:42','CF105',8,40016,'Flash CS4 Insight','',1,'singleactivity',0,5,1250208000,0,52,5242880,0,1,0,0,0,1250146290,0,0,'en','','2025-09-01 11:41:18','2025-09-01 11:48:50'),('38','9364dd23-8728-11f0-92b5-c0dd14cab83b','Processes and Templates to be followed by DEV-QA','<br /><p style=\"margin:0in 0in 0pt;\" class=\"MsoNormal\"><span>This course has various processes and templates to be followed by developers and QA\'s. It helps in keeping track of different activities in a project and having a better communication protocol between developers and QA\'s.</span></p> ',0,'2009-08-14 06:43:49','Processes and Templates to be followed by DEV-QA',5,20954,'Processes and Templates to be followed by DEV-QA','',1,'topics',1,5,1239561000,0,3,5242880,0,1,0,0,0,1317631037,0,0,'','','2025-09-01 11:41:18','2025-09-01 11:48:50'),('40','9366d0f9-8728-11f0-92b5-c0dd14cab83b','Email writing coaching','<br />\r <p>This course is intended to give the student an overview of different facets of writing an email. </p><p>This training session was conducted by Rahul Mulay, GM - Operations for entire HTV division.</p> ',0,'2009-08-21 04:27:10','Email writing',9,50015,'Email writing coaching','SSMW-01',1,'topics',1,5,1248805800,0,1,5242880,0,1,0,0,0,1317631134,0,0,'','','2025-09-01 11:41:18','2025-09-01 11:48:50'),('41','9368e0b2-8728-11f0-92b5-c0dd14cab83b','SQL Database Training','<br /><p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"font-size:10pt;font-family:arial;\"><font color=\"#333366\">This course has SQL Database basic training for developers and QA\'s. Which includes Basic Database Concepts, An Introduction to Transact SQL, Beginning Transact SQL and Intermediate Transact SQL.</font></span></span></p><p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"font-size:10pt;font-family:arial;\"><font color=\"#333366\">This training was conducted by Ashok Gaikwad, DBA for MS QA team members.</font></span></span></p> ',0,'2009-08-24 04:54:21','SQLTraining',5,20955,'SQL Database Training','',1,'weeks',1,5,1250533800,1251750600,2,5242880,0,1,0,0,0,1317631436,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('43','936baf8e-8728-11f0-92b5-c0dd14cab83b','Application Design Patterns and Principles','<br /><p><span lang=\"en-in\" style=\"font-size:11pt;line-height:115%;font-family:calibri;\" xml:lang=\"en-in\">This training aims at introducing participants to effective Object Oriented Design Principles, practices and patterns. This foundation course will help candidate in understanding and using advanced patterns and designs like J2EE patterns.</span></p><p style=\"margin-right:0px;\" dir=\"ltr\"><span lang=\"en-in\" style=\"font-size:11pt;line-height:115%;font-family:calibri;\" xml:lang=\"en-in\">This training program was conducted by an external faculty who works as Corporate Trainer and Mentor with leading software and Technology companies.</span></p> ',0,'2009-08-24 12:33:41','Application Design Patterns and Principles',5,20956,'Application Design Patterns and Principles','',1,'weeks',1,5,1242930600,1244752200,3,5242880,0,1,0,0,0,1405417737,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('45','936e2c8d-8728-11f0-92b5-c0dd14cab83b','Introduction to XML-XSD-XSLT','<br /><p style=\"margin-right:0px;\" dir=\"ltr\">The objective of this training is to give an introduction on XML, XSD &amp; XSLT.</p> ',0,'2009-09-02 23:01:13','Introduction to XML-XSD-XSLT',5,20957,'Introduction to XML-XSD-XSLT','',1,'weeks',1,5,1247769000,1248381000,1,5242880,0,1,0,0,0,1317631854,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('46','9370ad84-8728-11f0-92b5-c0dd14cab83b','Human-Computer Interaction Design and Usability Practices','<p><span cl