<li>Databinding </li><li>WCF - Web services<br /></li><li>Microsoft Expression Blend - Basics </li><li>Out of browser usage </li></ul>Prerequisite: ASP.NET, C#, XML<br />',0,'2009-09-10 09:57:42','Silverlight 3.0 - Basic Training',5,20959,'Microsoft Silverlight 3.0 - Basic Training (Internal)','',1,'weeks',1,5,1253471400,1254688200,2,5242880,0,1,0,0,0,1317706642,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('50','9374ef2e-8728-11f0-92b5-c0dd14cab83b','Microsoft Silverlight 3.0 - Basic Training - 3 days workshop at Seed Infotech','<br /><p>This course is intended for providing basic knowledge on Microsoft Silverlight 3.0. The course covers the following areas:<br /></p><ul><li>Silverlight architecture, work flow, XAML, xap file format<br /></li><li>LINQ to SQL <br /></li><li>Databinding </li><li>WCF - Web services<br /></li><li>Microsoft Expression Blend - Basics </li><li>Out of browser usage </li></ul>Prerequisite: ASP.NET, C#, XML ',0,'2009-09-11 12:53:31','MS SIL 3.0',5,20960,'Microsoft Silverlight 3.0 - Basic Training - 3 days workshop at Seed Infotech','',1,'weeks',1,5,1249583400,1250195400,1,5242880,0,1,0,0,0,1317706818,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('51','9376ddfd-8728-11f0-92b5-c0dd14cab83b','User Experience Design','<p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span>This training session was conducted by Atul Joshi, the chief Course Instructor of Design Incubator firm.</span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span></span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span></span></p><p class=\"MsoNormal\" style=\"margin:0in 0in 0pt;\"><span>This course covers information about the process followed in designing any product as well as elearning courses. You will find information about various phases of ADDIE model mapping to the design process. Also information related to structural approach to GUI visualization and prototype is covered in this course. </span></p>',0,'2009-09-16 09:22:56','UED',7,30048,'User Experience Design','',1,'topics',1,5,1253145600,0,1,5242880,0,1,0,0,0,1253772915,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('52','937eba1b-8728-11f0-92b5-c0dd14cab83b','Flash Training (Aug 2009)','Macromedia coined the term rich Internet application (RIA). RIAs combine the flexibility, responsiveness, and ease of use of desktop applications with the broad reach of the web. RIAs provide a dynamic web experience that is rich and engaging, as well as interactive. Many web designers and developers use Adobe Flash or Adobe Flex, which are part of the Adobe Flash Platform, to build RIAs. Flash is an authoring environment for creating rich, interactive content for the web. Flex is a cross-platform development framework for creating RIAs. Content created with Flash and Flex is deployed using Adobe Flash Player. This course explores the basics of creating RIA\'s using the Flash Technology. The primary focus of this course revolves around action scripting. ',0,'2009-08-07 11:59:53','Flash Training - Aug 2009',8,40017,'Flash Training (Aug 2009)','',1,'weeks',0,5,1251158400,1256004000,8,5242880,0,1,0,0,0,1257165827,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('53','93834449-8728-11f0-92b5-c0dd14cab83b','Quality Management System','<br />\r <p>A quality management system in accordance with ISO 9001:2000 provides a set of processes that ensures a common approach to the management of the organization. </p><p>The system ensures consistency and improvement of working practices, which in turn provides products and services that meet customer\'s requirements. ISO 9000 is the most commonly used international standard that provides a framework for an effective quality management system. </p> ',0,'2009-09-17 10:54:21','QMS',9,50014,'Quality Management System','',1,'topics',1,5,1253212200,0,1,5242880,0,1,0,0,0,1317707026,0,0,'','','2025-09-01 11:41:19','2025-09-01 11:48:50'),('54','938c8e22-8728-11f0-92b5-c0dd14cab83b','Innovation Offsite 2