ase Camp 2011\" /></strong></p><p>Base Camp 2012 is a blended learning program in its third edition.<br /></p><p>The goal of <span style=\"font-weight:bold;\">Base Camp 2012 </span>is to help participants explore the basics of strategic planning, organization learning and leadership through interesting stories, case studies, articles and presentations. Accordingly, lessons in the curriculum are classified in these three categories.<br /><br /><span style=\"font-weight:bold;\">Base Camp 2012 </span>combines classroom instruction with e-learning, blogs, tweets, podcasts, videos, online case studies and print material. We will use interactive tools such as blogger, Raptivity, TeemingPod and Moodle. The program is in a weekly format. <br /></p><span style=\"font-weight:bold;\">Base Camp 2012 </span>starts on Nov 19, 2010 and will conclude on December 20. <br /><br /><span style=\"font-weight:bold;\">Base Camp 2012 </span>uses the platform of Base Camp 2010 created by Vikas. We hope that you will enjoy it and benefit from it. Feel free to email feedback at <a href=\"mailto:abhay.patil@harbingergroup.com\">abhay.patil@harbingergroup.com</a>.<br />',0,NULL,'Base Camp 2012',10,60086,'Base Camp 2012','',1,'topics',1,1,1321641000,0,3,0,0,1,0,0,0,1324298432,0,0,'','','2025-09-01 11:41:21','2025-09-01 11:41:21'),('176','94b0590f-8728-11f0-92b5-c0dd14cab83b','Basic Java Training','<p>This is a basic Java course.</p>',0,NULL,'BasicJava',5,20763,'Basic Java Training','',1,'topics',1,1,1322764200,0,14,10240,0,0,0,0,0,1334758237,0,0,'','','2025-09-01 11:41:21','2025-09-01 11:41:21'),('177','94b28ff4-8728-11f0-92b5-c0dd14cab83b','Spring Workshop - December 2011','<p><font color=\"#000066\" size=\"2\">Spring Workshop - Case Study based training approach (60% practical &amp; 40% theory)</font></p><p><font size=\"2\"><em>Trainer</em>: <font color=\"#660000\">Zubin K</font> (external trainer)<br /><em>Duration</em>: 16 hours (Spread over two days - 22<sup>nd</sup> &amp; 24<sup>th</sup> D