 Features of SQL.</font></p><br /><div align=\"left\"><span><span>.<span></span></span></span>Basics of database design.<br /><br /><span><span>a.<span></span></span></span>Normalization, de-normalization, create database etc.<br /><span><span>2.<span></span></span></span>Designing Tables.<br /><span><span>a.<span></span></span></span>Data types.<br /><span><span>b.<span></span></span></span>Creating tables.<br /><span><span>c.<span></span></span></span>Constraints.<span><span><span><br /></span>i.<span></span></span></span>Primary key, Foreign key, Null, Not Null, Index etc<br /><br /><span><span>3.<span></span></span></span>Select queries.<br /><span><span>a.<span></span></span></span>Select, from, where, order by, group by, order by, having, union/union all etc.</div><p class=\"MsoNormal\"></p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>4.<span></span></span></span>Indexes.</p><p class=\"MsoListParagraph\" style=\"margin-left:1in;text-indent:-.25in;\"><span><span>a.<span></span></span></span>Clustered, non clustered, filtered etc.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>5.<span></span></span></span>Views.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>6.<span></span></span></span>Stored procedure &amp; function.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>7.<span></span></span></span>Transactions</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>8.<span></span></span></span>Trigger.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>9.<span></span></span></span>Cursor.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span><span>10.<span></span></span></span>Dynamic SQL.</p><p class=\"MsoNormal\"></p><p class=\"MsoNormal\">Advanced SQL.</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;\"><span style=\"font-family:symbol;\"><span>·<span></span></span></span>What is query 